import React from 'react';
import { func } from 'prop-types';
import styled, { css } from 'styled-components';
import { Flex } from '../../atoms';
import {ThanksCenter} from '../../molecules';

const SizedText = styled(Flex)`
  ${({theme: {sizing}}) => css`
    width: ${sizing.thanksText};  
    margin: auto;
  `}
`;

const ThanksTextOrganism = ({handleRedirectToPage}) => {
  return(
        <SizedText 
          display='block' 
          lineHeight='sm' 
          paddingBottom='xl9'
        >
          <ThanksCenter.ThanksTitle/>
          <ThanksCenter.ThanksLink handleRedirectToPage={handleRedirectToPage}/>
        </SizedText>
  )
};

ThanksTextOrganism.propTypes = {
  handleRedirectToPage: func,
}

export default ThanksTextOrganism;
